import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
// import * as serviceWorker from './serviceWorker';
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import Routes from './config/routes'

ReactDOM.render(
  <Routes />
  , document.getElementById('root')
);

